import React, { useContext, useEffect, useState } from "react";
import "../Popup/popup.css";
import { scheme } from "../../Components/Portfolio";

const Popup = () => {
  const schemecode = useContext(scheme);
  const [state, setState] = useState();

  useEffect(async () => {
    const schemedetails = await fetch(`https://api.mfapi.in/mf/${schemecode}`);
    const schemedetailsjson = schemedetails.json();
    if (schemedetailsjson) {
      console.log("prom", schemedetailsjson.meta.fund_house);
    } else {
      console.log("get");
    }

    // console.log("details", schemedetailsjson.Object);
    setState(schemedetailsjson);
  }, []);

  return (
    <div className="popup">
      <div className="inner_popup">
        <p>{schemecode}</p>
        {/* <p style={{ color: "green" }}>{state.meta.fund_house}</p> */}
        {/* <p></p> */}
      </div>
    </div>
  );
};

export default Popup;
